(156, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:77:\"Monday Masterclass: How to Build an Online Store With WooCommerce & Elementor\";s:7:\"excerpt\";s:185:\"We are happy to be back with our Monday Masterclasses after a short break. This week we will take you through the exciting process of building a WordPress online store with WooCommerce.\";s:7:\"created\";s:10:\"1572856019\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:155:\"https://elementor.com/blog/how-to-build-an-online-store-with-woocommerce-elementor/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:38:\"Podcast #52: Growing Your Online Sales\";s:7:\"excerpt\";s:206:\"Greg Karelitz, global manager of HubSpot for Startups, explains why and when you need to use CRM, describes the first steps of email automation, and shares tips on planning your sales journey the right way.\";s:7:\"created\";s:10:\"1572512063\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:124:\"https://elementor.com/blog/podcast-52-greg-karelitz/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:38:\"Hilarious Stories of Nightmare Clients\";s:7:\"excerpt\";s:148:\"This Halloween, we asked our community to share their most gruesome clients. These stories cracked us up, and we hope they will do the same for you!\";s:7:\"created\";s:10:\"1572353741\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:117:\"https://elementor.com/blog/nightmare-clients/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:34:\"WordCamp US 2019  Here We Come!\";s:7:\"excerpt\";s:84:\"Elementor is coming to WordCamp US  St. Louis, and we hope to see you guys there.\";s:7:\"created\";s:10:\"1572346501\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:116:\"https://elementor.com/blog/wordcamp-us-2019/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:71:\"How to Use Dynamic User Profile Pictures & Dynamic Numbers in Elementor\";s:7:\"excerpt\";s:197:\"In this tutorial, we\'re going to show you how you can use Elementor\'s dynamic content integrations to create personalized project overview pages for your clients, complete with a custom login page.\";s:7:\"created\";s:10:\"1571979674\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:107:\"https://elementor.com/blog/?p=31825&utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
