 10 of our students have cleared their Exams\\u201d. DARN is the competitive exams coaching institute to have a great success rate in Karachi. Because of the facilities like the full-fledged computer lab, library and solo and practice Programs extended to our students.\\u201d<\\/p>\",\"_id\":\"d982347\"},{\"tab_title\":\"Q2. What is the difference between DARN and the other institutes?\",\"tab_content\":\"<p>A. DARN Coaching Institute has received the Best coaching institute in Education Award of the year 2017 and 2018. We actually don\\u2019t get compromised on Materials, Staff, Library, computer lab, Mentors, Mock Interview, etc.Staff will be available 24 Hours for Doubt Clarification Room (DCR). Our Ex-students proudly call DARN Coaching Institute as \\u201cTHE KING MAKER\\u201d.<\\/p>\",\"_id\":\"49085ac\"},{\"tab_title\":\"Q3. How many Students are in each class?\",\"tab_content\":\"<p>A. There are around 40-50 students in each class depending on the requirement.<\\/p>\",\"_id\":\"b7ee0a8\"},{\"tab_title\":\"Q4. Tell about the timings of this institute.\",\"tab_content\":\"<p>A. -Monday to Thursday - 8:00 am to 4:30 pm<br \\/>-Friday - 8:00 am to 1:30 pm<br \\/>-Saturday \\u2013 10:00 am to 3:30 pm<br \\/>-Sunday \\u2013 off<\\/p>\",\"_id\":\"69896f8\"},{\"tab_title\":\"Q5. Will staff available to clarify my doubts after class timings?\",\"tab_content\":\"<p>A. Yes.Faculties will be available for doubt clarifications round the clock. You can ask relevant questions to your teachers in class timings too.<\\/p>\",\"_id\":\"4f5060e\"}],\"border_width\":{\"unit\":\"px\",\"size\":2,\"sizes\":[]},\"border_color\":\"#000000\",\"title_color\":\"#2e2a8c\",\"tab_active_color\":\"#0300e8\",\"title_typography_typography\":\"custom\",\"title_typography_font_size\":{\"unit\":\"px\",\"size\":19,\"sizes\":[]},\"icon_align\":\"right\",\"icon_space\":{\"unit\":\"px\",\"size\":0,\"sizes\":[]},\"content_color\":\"#000000\",\"content_typography_typography\":\"custom\",\"content_typography_font_size\":{\"unit\":\"px\",\"size\":17,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"accordion\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"ce7cc29\",\"elType\":\"section\",\"settings\":{\"content_delay_time\":\"0.50\",\"background_background\":\"classic\",\"background_image\":{\"url\":\"http:\\/\\/localhost\\/diyafatima-parallax\\/wp-content\\/uploads\\/2019\\/11\\/blue_background.jpg\",\"id\":198},\"background_attachment\":\"fixed\",\"background_size\":\"cover\",\"section_parallax_on\":\"yes\",\"border_border\":\"solid\",\"border_width\":{\"unit\":\"px\",\"top\":\"5\",\"right\":\"5\",\"bottom\":\"5\",\"left\":\"5\",\"isLinked\":true},\"border_radius\":{\"unit\":\"px\",\"top\":\"10\",\"right\":\"10\",\"bottom\":\"10\",\"left\":\"10\",\"isLinked\":true},\"margin\":{\"unit\":\"px\",\"top\":\"75\",\"right\":0,\"bottom\":\"75\",\"left\":0,\"isLinked\":true}},\"elements\":[{\"id\":\"8b21521\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"55ac2a2\",\"elType\":\"section\",\"settings\":{\"content_delay_time\":\"0.50\",\"structure\":\"20\"},\"elements\":[{\"id\":\"eaad3ae\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":25.291},\"elements\":[{\"id\":\"6900538\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost\\/diyafatima-parallax\\/wp-content\\/uploads\\/2019\\/11\\/scholar1.jpg\",\"id\":189},\"align\":\"center\",\"opacity\":{\"unit\":\"px\",\"size\":1,\"sizes\":[]},\"image_border_radius\":{\"unit\":\"px\",\"top\":\"200\",\"right\":\"200\",\"bottom\":\"200\",\"left\":\"200\",\"isLinked\":true}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":true},{\"id\":\"4661b1f\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":74.709},\"elements\":[{\"id\":\"8bbc955\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<h1>Scholarships For Bright Students<\\/h1><h2 style=\\\"margin-bottom: 0px; font-size: 28px; color: #000000; font-family: montserra