ve a great success rate in Karachi. Because of the facilities like the full-fledged computer lab, library and solo and practice Programs extended to our students.\\u201d<\\/p>\",\"_id\":\"d982347\"},{\"tab_title\":\"Q2. What is the difference between DARN and the other institutes?\",\"tab_content\":\"<p>A. DARN Coaching Institute has received the Best coaching institute in Education Award of the year 2017 and 2018. We actually don\\u2019t get compromised on Materials, Staff, Library, computer lab, Mentors, Mock Interview, etc.Staff will be available 24 Hours for Doubt Clarification Room (DCR). Our Ex-students proudly call DARN Coaching Institute as \\u201cTHE KING MAKER\\u201d.<\\/p>\",\"_id\":\"49085ac\"},{\"tab_title\":\"Q3. How many Students are in each class?\",\"tab_content\":\"<p>A. There are around 40-50 students in each class depending on the requirement.<\\/p>\",\"_id\":\"b7ee0a8\"},{\"tab_title\":\"Q4. Tell about the timings of this institute.\",\"tab_content\":\"<p>A. -Monday to Thursday - 8:00 am to 4:30 pm<br \\/>-Friday - 8:00 am to 1:30 pm<br \\/>-Saturday \\u2013 10:00 am to 3:30 pm<br \\/>-Sunday \\u2013 off<\\/p>\",\"_id\":\"69896f8\"},{\"tab_title\":\"Q5. Will staff available to clarify my doubts after class timings?\",\"tab_content\":\"<p>A. Yes.Faculties will be available for doubt clarifications round the clock. You can ask relevant questions to your teachers in class timings too.<\\/p>\",\"_id\":\"4f5060e\"}]},\"elements\":[],\"widgetType\":\"accordion\"}],\"isInner\":false}],\"isInner\":false}]'),
