\",\"size\":51,\"sizes\":[]},\"_margin\":{\"unit\":\"px\",\"top\":\"7\",\"right\":\"7\",\"bottom\":\"7\",\"left\":\"7\",\"isLinked\":true}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"38d9285\",\"elType\":\"widget\",\"settings\":{\"text\":\"Click here\",\"align\":\"left\",\"size\":\"lg\",\"selected_icon\":{\"value\":\"fas fa-book\",\"library\":\"fa-solid\"},\"icon_align\":\"right\",\"icon_indent\":{\"unit\":\"px\",\"size\":14,\"sizes\":[]},\"text_shadow_text_shadow_type\":\"yes\",\"text_shadow_text_shadow\":{\"horizontal\":0,\"vertical\":0,\"blur\":15,\"color\":\"rgba(64,84,178,0.3)\"},\"button_text_color\":\"#000000\",\"background_color\":\"#0300e8\",\"border_border\":\"solid\",\"border_color\":\"#000000\",\"border_radius\":{\"unit\":\"px\",\"top\":\"17\",\"right\":\"17\",\"bottom\":\"17\",\"left\":\"17\",\"isLinked\":true}},\"elements\":[],\"widgetType\":\"button\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"1cfd90d\",\"elType\":\"section\",\"settings\":{\"content_delay_time\":\"0.50\"},\"elements\":[{\"id\":\"99d0b43\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"46f8275\",\"elType\":\"widget\",\"settings\":{\"title\":\"FREQUENTLY ASKED QUESTIONS\",\"size\":\"xl\",\"header_size\":\"h1\",\"align\":\"center\",\"title_color\":\"#000000\",\"typography_typography\":\"custom\"},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"8b12ed4\",\"elType\":\"section\",\"settings\":{\"stretch_section\":\"section-stretched\",\"layout\":\"full_width\",\"content_delay_time\":\"0.50\",\"margin\":{\"unit\":\"px\",\"top\":\"10\",\"right\":0,\"bottom\":\"10\",\"left\":0,\"isLinked\":true}},\"elements\":[{\"id\":\"2e01f0b\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"f3bf190\",\"elType\":\"widget\",\"settings\":{\"tabs\":[{\"tab_title\":\"Q1. What is the success rate of DARN Learning Studio?\",\"tab_content\":\"<p>A. We can proudly say that \\u201c9 out of 10 of our students have cleared their Exams\\u201d. DARN is the competitive exams coaching institute to have a great success rate in Karachi. Because of the facilities like the full-fledged computer lab, library and solo and practice Programs extended to our students.\\u201d<\\/p>\",\"_id\":\"d982347\"},{\"tab_title\":\"Q2. What is the difference between DARN and the other institutes?\",\"tab_content\":\"<p>A. DARN Coaching Institute has received the Best coaching institute in Education Award of the year 2017 and 2018. We actually don\\u2019t get compromised on Materials, Staff, Library, computer lab, Mentors, Mock Interview, etc.Staff will be available 24 Hours for Doubt Clarification Room (DCR). Our Ex-students proudly call DARN Coaching Institute as \\u201cTHE KING MAKER\\u201d.<\\/p>\",\"_id\":\"49085ac\"},{\"tab_title\":\"Q3. How many Students are in each class?\",\"tab_content\":\"<p>A. There are around 40-50 students in each class depending on the requirement.<\\/p>\",\"_id\":\"b7ee0a8\"},{\"tab_title\":\"Q4. Tell about the timings of this institute.\",\"tab_content\":\"<p>A. -Monday to Thursday - 8:00 am to 4:30 pm<br \\/>-Friday - 8:00 am to 1:30 pm<br \\/>-Saturday \\u2013 10:00 am to 3:30 pm<br \\/>-Sunday \\u2013 off<\\/p>\",\"_id\":\"69896f8\"},{\"tab_title\":\"Q5. Will staff available to clarify my doubts after class timings?\",\"tab_content\":\"<p>A. Yes.Faculties will be available for doubt clarifications round the clock. You can ask relevant questions to your teachers in class timings too.<\\/p>\",\"_id\":\"4f5060e\"}],\"border_width\":{\"unit\":\"px\",\"size\":2,\"sizes\":[]},\"border_color\":\"#000000\",\"title_color\":\"#2e2a8c\",\"tab_active_color\":\"#0300e8\",\"title_typography_typography\":\"custom\",\"title_typography_font_size\":{\"unit\":\"px\",\"size\":19,\"sizes\":[]},\"icon_align\":\"right\",\"icon_space\":{\"unit\":\"px\",\"size\":0,\"sizes\":[]},\"content_color\":\"#000000\",\"content_typography_typography\":\"custom\",\"content_t