(25, 1, '2019-11-05 12:01:12', '2019-11-05 12:01:12', '<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Our website address is: http://localhost/diyafatima-parallax.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What personal data we collect and why we collect it</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comments</h3><!-- /wp:heading --><!-- wp:paragraph --><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contact forms</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Embedded content from other websites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Your contact information</h2><!-- /wp:heading --><!-- wp:heading --><h2>Additional information</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>How we protect your data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What data breach procedures we have in place</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What third parties we receive data from</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What automated decision making and/or profiling we do with user data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Industry regulatory disclosure requirements</h3><!-- /wp:heading -->', 'Privacy Policy', '', 'inherit', 'closed', 'closed', '', '3-revision-v1', '', '', '2019-11-05 12:01:12', '2019-11-05 12:01:12', '', 3, 'http://localhost/diyafatima-parallax/2019/11/05/3-revision-v1/', 0, 'revision', '', 0),
(26, 1, '2019-11-05 12:01:13', '2019-11-05 12:01:13', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost/diyafatima-parallax/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->', 'Sample Page', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2019-11-05 12:01:13', '2019-11-05 12:01:13', '', 2, 'http://localhost/diyafatima-parallax/2019/11/05/2-revision-v1/', 0, 'revision', '', 0),
(27, 1, '2019-11-05 12:01:26', '2019-11-05 12:01:26', '<h2>DARN Learning Studio</h2>		\n			<h6>Scholarships For Bright Students</h6>		\n			<a href=\"#\" role=\"button\">\n						Click here\n					</a>\n			<figure><img width=\"214\" height=\"214\" src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/ava2.jpg\" alt=\"ava2\" srcset=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/ava2.jpg 214w, http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/ava2-150x150.jpg 150w\" sizes=\"(max-width: 214px) 100vw, 214px\" /></figure><h3>Kanwal Iqbal<h4 style=\"box-sizing: inherit; font-size: 20px; font-family: segoe-emoji; color: rgb(0, 0, 0); letter-spacing: normal; white-space: normal;\">English Lecturer at TU</h4></h3><p>I have learnt a lot in my time at the academy. The environment is professional and the instructors really know their craft. Instructors go above and beyond their duties to help the students.</p>		\n			<figure><img width=\"215\" height=\"216\" src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/avam2.jpg\" alt=\"avam2\" srcset=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/avam2.jpg 215w, http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/avam2-150x150.jpg 150w\" sizes=\"(max-width: 215px) 100vw, 215px\" /></figure><h3>Muhammad Alvi<h4 style=\"box-sizing: inherit; font-size: 20px; font-family: segoe-emoji; color: rgb(0, 0, 0); letter-spacing: normal; white-space: normal;\">Student</h4></h3><p>High qualified staff, learned much from DARN... hope for best future guides. Thumbs Up For DARN Learning Studio </p>		\n		<p>\"Education is the most powerful weapon which you<br />can use to change the world\".</p><p><em>--<b>Nelson Mandela</b>--</em></p><p>\"The roots of education are bitter,<br />but the fruit is sweet\".</p><p><em>--<b>Aristotle</b>--</em></p><h1>We Also Provide Online Documents For Students</h1>\n<h4>Past Papers Of AKU-EB :</h4>\n<ul>\n 	<li><a href=\"https://drive.google.com/drive/folders/0B5prfHWWrBKhejVpRWxEaHVWV0E?usp=sharing\" target=\"_blank\" style=\"color:black;\" rel=\"noopener noreferrer\">Past Papers SSC Part I (Class IX)</a></li>\n 	<li><a href=\"https://drive.google.com/drive/folders/0B5prfHWWrBKhbUlkb3hqTmlLV28?usp=sharing\" target=\"_blank\" style=\"color:black;\" rel=\"noopener noreferrer\">Past Papers SSC Part II (Class X)</a></li>\n</ul>		\n				0\n							Students\n				0\n							Teachers\n				0\n							Cups Of Tea\n						Our Achievements Since 1999:\n				Students Achieving A+ Grade\n									85%\n							Ratings By DARN Alumni\n						<i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i> 4.5/5		\n			<h2>Share Your Views:</h2>		\n			<a href=\"http://localhost/diyafatima-parallax/contact/\" role=\"button\">\n						Click here\n					</a>\n			<h2>Or Follow Us On:</h2>		\n							<a href=\"https://www.facebook.com/\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Facebook\n									</a>\n							<a href=\"https://twitter.com/\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Twitter\n									</a>\n							<a href=\"https://www.instagram.com/\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Instagram\n									</a>\n							<a href=\"https://pk.linkedin.com/\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Linkedin\n									</a>\n							<a href=\"https://www.snapchat.com/\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Snapchat\n									</a>', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2019-11-06 18:20:28', '2019-11-06 18:20:28', '', 0, 'http://localhost/diyafatima-parallax/?page_id=27', 0, 'page', '', 0),
