(83, 1, '2019-11-05 15:46:22', '2019-11-05 15:46:22', '<h2>DARN Learning Studio</h2>		\n			<h6>Scholarships For Bright Students</h6>		\n			<figure><img width=\"216\" height=\"233\" src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/ava.png\" alt=\"ava\" /></figure><h3>Kanwal Iqbal<h4 style=\"box-sizing: inherit; font-size: 20px; font-family: segoe-emoji; color: rgb(0, 0, 0); letter-spacing: normal; white-space: normal;\">English Lecturer at TU</h4></h3><p>I have learnt a lot in my time at the academy. The environment is professional and the instructors really know their craft. Instructors go above and beyond their duties to help the students.</p>		\n			<figure><img width=\"216\" height=\"233\" src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/avam.png\" alt=\"\" /></figure><h3>Muhammad Alvi<h4 style=\"box-sizing: inherit; font-size: 20px; font-family: segoe-emoji; color: rgb(0, 0, 0); letter-spacing: normal; white-space: normal;\">Student</h4></h3><p>High qualified staff, learned much from DARN... hope for best future guides.</p>', 'Home', '', 'inherit', 'closed', 'closed', '', '27-revision-v1', '', '', '2019-11-05 15:46:22', '2019-11-05 15:46:22', '', 27, 'http://localhost/diyafatima-parallax/2019/11/05/27-revision-v1/', 0, 'revision', '', 0),
