(125, 1, '2019-11-05 16:41:24', '2019-11-05 16:41:24', '<h2>DARN Learning Studio</h2>		\n			<h6>Scholarships For Bright Students</h6>		\n			<figure><img width=\"216\" height=\"233\" src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/ava.png\" alt=\"ava\" /></figure><h3>Kanwal Iqbal<h4 style=\"box-sizing: inherit; font-size: 20px; font-family: segoe-emoji; color: rgb(0, 0, 0); letter-spacing: normal; white-space: normal;\">English Lecturer at TU</h4></h3><p>I have learnt a lot in my time at the academy. The environment is professional and the instructors really know their craft. Instructors go above and beyond their duties to help the students.</p>		\n			<figure><img width=\"216\" height=\"233\" src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/avam.png\" alt=\"\" /></figure><h3>Muhammad Alvi<h4 style=\"box-sizing: inherit; font-size: 20px; font-family: segoe-emoji; color: rgb(0, 0, 0); letter-spacing: normal; white-space: normal;\">Student</h4></h3><p>High qualified staff, learned much from DARN... hope for best future guides.</p>		\n		<p>\"Education is the most powerful weapon which you<br />can use to change the world\".</p><p><em>--<b>Nelson Mandela</b>--</em></p><p>\"The roots of education are bitter,<br />but the fruit is sweet\".</p><p><em>--<b>Aristotle</b>--</em></p>		\n			<h1><u>Environment</u></h1>		\n			<dl class=\'gallery-item\'>\n			<dt class=\'gallery-icon landscape\'>\n				<a data-elementor-open-lightbox=\"default\" data-elementor-lightbox-slideshow=\"ca41cfb\" href=\'http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/gallery17-1.jpg\'><img width=\"150\" height=\"150\" src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/gallery17-1-150x150.jpg\" alt=\"\" srcset=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/gallery17-1-150x150.jpg 150w, http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/gallery17-1-160x160.jpg 160w, http://localhost/diyafatima-paralla