ocalhost/diyafatima-parallax/wp-content/uploads/2019/11/gallery18-1-150x150.jpg\" alt=\"gallery18\" /></figure><figure><img src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/scholar-150x150.jpg\" alt=\"Print\" /></figure><figure><img src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/gallery17-2-150x150.jpg\" alt=\"gallery17\" /></figure><figure><img src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/gallery15-150x150.jpg\" alt=\"gallery15\" /></figure><figure><img src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/gallery19-150x150.jpg\" alt=\"gallery19\" /></figure><figure><img src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/gallery13-1-150x150.jpg\" alt=\"gallery13\" /></figure>			\n						Previous\n						Next\n			<h1>You Can Read Books Online</h1>		\n			<a href=\"#\" role=\"button\">\n						Click here\n					</a>\n			<h1>FREQUENTLY ASKED QUESTIONS</h1>		\n												<a href=\"\">Q1. What is the success rate of DARN Learning Studio?</a>\n					<p>A. We can proudly say that 9 out of 10 of our students have cleared their Exams. DARN is the competitive exams coaching institute to have a great success rate in Karachi. Because of the facilities like the full-fledged computer lab, library and solo and practice Programs extended to our students.</p>\n												<a href=\"\">Q2. What is the difference between DARN and the other institutes?</a>\n					<p>A. DARN Coaching Institute has received the Best coaching institute in Education Award of the year 2017 and 2018. We actually dont get compromised on Materials, Staff, Library, computer lab, Mentors, Mock Interview, etc.Staff will be available 24 Hours for Doubt Clarification Room (DCR). Our Ex-students proudly call DARN Coaching Institute as THE KING MAKER.</p>\n												<a href=\"\">Q3. How many Students are in each class?</a>\n					<p>A. There are around 40-50 students in each class depending on the requirement.</p>\n												<a href=\"\">Q4. Tell about the timings of this institute.</a>\n					<p>A. -Monday to Thursday &#8211; 8:00 am to 4:30 pm<br />-Friday &#8211; 8:00 am to 1:30 pm<br />-Saturday  10:00 am to 3:30 pm<br />-Sunday  off</p>\n												<a href=\"\">Q5. Will staff available to clarify my doubts after class timings?</a>\n					<p>A. Yes.Faculties will be available for doubt clarifications round the clock. You can ask relevant questions to your teachers in class timings too.</p>', 'About Us', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2019-11-05 20:07:19', '2019-11-05 20:07:19', '', 9, 'http://localhost/diyafatima-parallax/2019/11/05/9-revision-v1/', 0, 'revision', '', 0),
