(227, 1, '2019-11-06 18:19:41', '2019-11-06 18:19:41', '<h2>DARN Learning Studio</h2>		\n			<h6>Scholarships For Bright Students</h6>		\n			<a href=\"#\" role=\"button\">\n						Click here\n					</a>\n			<figure><img width=\"214\" height=\"214\" src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/ava2.jpg\" alt=\"ava2\" srcset=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/ava2.jpg 214w, http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/ava2-150x150.jpg 150w\" sizes=\"(max-width: 214px) 100vw, 214px\" /></figure><h3>Kanwal Iqbal<h4 style=\"box-sizing: inherit; font-size: 20px; font-family: segoe-emoji; color: rgb(0, 0, 0); letter-spacing: normal; white-space: normal;\">English Lecturer at TU</h4></h3><p>I have learnt a lot in my time at the academy. The environment is professional and the instructors really know their craft. Instructors go above and beyond their duties to help the students.</p>		\n			<figure><img width=\"215\" height=\"216\" src=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/avam2.jpg\" alt=\"avam2\" srcset=\"http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/avam2.jpg 215w, http://localhost/diyafatima-parallax/wp-content/uploads/2019/11/avam2-150x150.jpg 150w\" sizes=\"(max-width: 215px) 100vw, 215px\" /></figure><h3>Muhammad Alvi<h4 style=\"box-sizing: inherit; font-size: 20px; font-family: segoe-emoji; color: rgb(0, 0, 0); letter-spacing: normal; white-space: normal;\">Student</h4></h3><p>High qualified staff, learned much from DARN... hope for best future guides.</p>		\n		<p>\"Education is the most powerful weapon which you<br />can use to change the world\".</p><p><em>--<b>Nelson Mandela</b>--</em></p><p>\"The roots of education are bitter,<br />but the fruit is sweet\".</p><p><em>--<b>Aristotle</b>--</em></p><h1>We Also Provide Online Documents For Students</h1>\n<h4>Past Papers Of AKU-EB :</h4>\n<ul>\n 	<li><a href=\"https://drive.google.com/drive/folders/0B5pr